function listFonts() {
  const { fonts } = document;
  const it = fonts.entries();
  const arr = [];
  let done = false;
  while (!done) {
    const font = it.next();
    if (!font.done) {
      arr.push(font.value[0].family);
    } else {
      done = font.done;
    }
  }
  return Array.from(new Set(arr));
}

